import React from 'react';
import { Button } from 'react-bootstrap';

interface BasicCareerProps {
  setVisible: (newVisibility: boolean) => void;
  visible: boolean;
}

export function BasicCareerComponent({ setVisible }: BasicCareerProps): JSX.Element {
  const handleBackToHome = () => {
    setVisible(false); // This will take you back to the HomePage
  };

  return (
    <div>
      <h1>Basic Career Component</h1>
      <p>This is the basic career page content.</p>
      <Button onClick={handleBackToHome}>Go Back to Home</Button>
    </div>
  );
}
